  return (
    <div className="relative text-center" style={{ backgroundImage: `url(${BackgroundImage})` }}>
      <div className="absolute inset-0 flex justify-center items-center">
        {/* <img src={TriangleImage} alt="Triangle" className="h-32 w-auto" /> Size as needed */}
